(163, 0000000137, 893, '09-12-2016 09:47:01', 'Origin late in sending Pre Alert to destination. \n\nOrigin late in following up with Carrier at Origin to change original BL into SW Bill (late in telex release). ', 'CS destination office follow up with KMTC asking for DO release by providing telex release evidence from CS Origin office.\n\nCS Destination remind CS Origin to ensure Pre Alert available before shipment arrival, and ensure oBL already flagged SW Bill before shipment arrive. This is PREPAID shipment.', 'Preventive action : CS destination pull data from TANGO on report for Incoming Shipment for monitoring.', '', 'C0000000137-000', '09-12-2016 13:05:32', '', ''),
(164, 0000000136, 893, '09-12-2016 09:47:22', 'CS Origin miscomm and gave wrong info on DnD freetime at destination (5 days i/o 14 days from HMM).\n\nConsignee unable to clear the cargo immediately and incurring demurrage and storage charges.\n\nIncurring demurrage charges due to mistake info of free time from Origin. Demurrage claim is IDR 25,650,000 / USD 1,912.21', 'CS Origin follow up with Carrier/HMM to get extra freetime, however unable to get it.\n\nDue to cargo urgency Consignee pickup DO and paying extra demurrage charges first on behalf Schenker. Later on Consignee will claim Schenker with demurrage invoice is IDR 25,650,000. \n\nDestination office already issued invoice to Origin to cover claim from Consignee amounting USD 1,921.21', 'Preventive action : Firm/correct info on communication from CS Origin to CS destination on freetime DnD.', '', 'C0000000136-000', '09-12-2016 13:18:53', '', ''),
(165, 0000000138, 843, '14-12-2016 11:02:27', 'Has been informed before that the Empty Boxes will be sent to Surabaya with earliest schedule from Vendor as this will be co loaded with another shipment, therefore Marco only mentioned that Empty Boxes are needed before December 26th 2016\nFirst I got information fromToyopack that Empty Boxes has been departed from Jakarta on November 23rd 2016 and will arrived in the next 2 days to Surabaya. After check that Toyopack Team forgot to put the Empty Boxes that caused the delay.', 'I have checked again with them to send the Empty Boxes to the earliest date.\nAs per phone call that Empty Boxes will arrived in Surabaya within second week of December. But without any confirmation that Empty Boxes only can be sent on December 16th as Toyopack has to wait another co load goods to Surabaya.', 'In the next time I will take more serious handle for job that include any third vendor. I also will gather more detail information so this misscommunication will not happen again in the future.', 'November_16th_2016.pdf', 'C0000000138-000', '03-01-2017 10:10:19', '', ''),
(166, 0000000126, 893, '20-12-2016 17:03:24', 'Sulindafin needed complete information for Import charges, BC. 1.1 and pos# of cargo location, even if Schenker only charged D/O covering letter.', 'Schenker already provided Import Charges to Sulindafin. Schenker did not provide BC. 1.1 and pos# of cargo location to Sulindafin because they never asked for it. ', 'Preventive Action : Notify Sulindafin if they need any information to be communicated via email. Eventough for this case there\'s no verbal request per phone. Only notification via feedback system.', '', 'C0000000126-000', '20-12-2016 17:16:17', '', ''),
(167, 0000000140, 548, '22-12-2016 12:50:01', 'SYsmex always use EVA Air BR237 on Tuesday evening. we received doc at least 3-4 housr after ATA which mean around 17.00h.  ', 'Will inform NOA before 10am on wednesday', 'Will inform NOA before 10am on wednesday', '', 'C0000000140-000', '12-02-2017 16:40:25', '', ''),
(168, 0000000141, 696, '03-01-2017 14:13:18', 'Delivery during Weekend, Warehouse open Half day, postpone delivery on customer request, cargo arrive at Bandung in the evening and final consignee warehouse already closed, limitation trucking unit by vendor', 'Control trucking vendor for immd. delivery, good coordination and communication with consignee on latest update, follow consignee request for postpone delivery ', 'Preventive action : better sourcing trucking vendor for Bandung Area, better coordination between trucking vendor, consignee and warehouse for delivery during weekend. \n\nWe are grateful to serve NISHIYAMA and Thank you for trusting us as the nominated forwarder, we are committed to give a better services. Thank you for acknowledging our service. ', '', 'C0000000141-000', '06-01-2017 18:23:43', '', ''),
(169, 0000000142, 893, '19-01-2017 13:14:59', 'Customer request shipment with using Carrier UASC. However there\'s space problem, UASC is fully booked. Contract with UASC expire on Jan 22nd, afterwards rate is increased. Customer request ETD on Jan 23rd. Because no space with UASC, booking is releasing using CMA CGM, different carrier with different cost.', 'Sales already requested Pricing team to extend UASC rate until Jan 23rd with same price for one time approval. However it\'s rejected. Booking is released with alternative Carrier CMA CGM with higher cost and also because no space form UASC. Actually CMA CGM and YML rates are still cover, but unfortunately CMA CGM and YML rates are only valid until Jan 22nd, afterwards rate increase, and do not match with requested ETD by PT.Bridon (Jan 23rd).', 'Preventive Action : Sales will mention 3 shipping lines for each trade lane with price level for make easier customer choose the back up Carrier. Need pay attention on contract validity based on ETD plan.', '', 'C0000000142-000', '23-01-2017 11:47:29', '', ''),
(170, 0000000143, 565, '26-01-2017 11:48:38', 'no specific shipment details on this compliment', 'no specific shipment details on this compliment', 'no specific shipment details on this compliment', '', 'C0000000143-000', '26-01-2017 11:49:43', '', ''),
(171, 0000000144, 893, '27-01-2017 21:11:42', 'Investigation result by KMTC JKT :\nit\'s because late submission of correction notice from KMTC-TH to KMTC-ID. ', 'According to Pioneer KAM (Laura Olivia), readdress already done by Yusen as Pioneer\'s custom clearance agent on Jan 11th, 2017.', 'Preventive Action :\nKMTC-ID has reminded KMTC-TH about time frame of document submission to avoid same cases happened in the future, and it has been well acknowledged by KMTC-TH office as well. \nThis is based on info from MR.ARI BUDIONO (KMTC ID - Sales & Marketing Manager)', '', 'C0000000144-000', '27-01-2017 21:18:40', '', ''),
(172, 0000000145, 893, '27-01-2017 21:29:46', 'Carrier/Cosco is late in releasing BC & inform omit service to Schenker ID.\n\nCosco can only release Booking Confirmation one week before ETD.\nLess than one week before ETD, on Jan 20th Cosco inform there\'s omit service. \nBecause there\'s omit service, ETD Jan 25th changed to ETD Feb 01.\nAcceptable ETA SHA is Feb 09th, but due to omit service the ETA is after 09 Feb (deadline).\n\nThis is coupled with Lack of monitoring Booking Confirmation availability from Carrier & Notify Shipper & Overseas agent by Schenker ID.', 'Partial shipment in total 36 cbm is moving by Air to meet deadline before 09 Feb. \n\nSchenker SHA is willing to invest by paying AirFreight for potential business opportunity in the future from same Consignee.', 'Preventive Action:\nMore proactive in monitoring Booking Confirmation from Carrier\nImmediately notify Overseas agent if schedule/space/equipment not available\nMore proactive in communication with Shipper on BC status\nAll is done by Operation, and jointly monitored by Customer Service of Schenker ID.', '', 'C0000000145-000', '27-01-2017 21:47:37', '', ''),
(173, 0000000146, 893, '31-01-2017 18:50:49', 'Wrong data input when creating PIB, by Custom Clearance Team', 'Custom Clearance revised PIB, after reject by Custom\nSales create CAPA for Custom Clearance Team corrective actions', 'Preventive Action:\nSales create CAPA for Custom Clearance Team preventive actions\n', '', 'C0000000146-000', '31-01-2017 18:59:38', '', ''),
(174, 0000000147, 893, '31-01-2017 19:02:10', 'Wrong data input when creating PIB, by Custom Clearance Team', 'Custom Clearance revised PIB, after reject by Custom\nSales create CAPA for Custom Clearance Team corrective actions\n', 'Preventive Action:\nSales create CAPA for Custom Clearance Team preventive actions', '', 'C0000000147-000', '31-01-2017 19:03:59', '', ''),
(175, 0000000103, 698, '07-02-2017 14:38:40', '', '', '', '', 'C0000000103-000', '', '', ''),
(176, 0000000149, 777, '16-02-2017 15:15:08', '- transition task and looking for the best option and update 3 month quotation\n  need spek min RAM 2GB /16GB and adjustable budget Idr 1,700,000 and find for compare the current vendor', 'already coordinate with Pak Ahmad Saefudin ( Purchasing IT )  to make sure he get the fixed quotation from vendor tomorrow (17 Feb 2017) before lunch', 'will do the best and the fastest order quotation communication with vendor & Pak Ahmad Saefudin as Purchasing IT Coordinator and more communicative to requestor about the update', '', 'C0000000149-000', '16-02-2017 16:13:26', '', ''),
(177, 0000000150, 893, '28-02-2017 16:23:08', 'please refer to 8D attachment, this is corrected by Schenker ID for Schenker SG implementation', 'please refer to 8D attachment, this is corrected by Schenker ID for Schenker SG implementation', 'please refer to 8D attachment, this is corrected by Schenker ID for Schenker SG implementation', '8D_Form_Template_FORM_D_-_Chevron_(edit).doc', 'C0000000150-000', '07-03-2017 09:33:48', '', 'just pls up load the 8D here'),
(178, 0000000151, 893, '28-02-2017 16:30:52', 'Shipper informed possibly cargo damaged because dropped from forklift, but there\'s no damage evidence.\n\nShipment possibly already damaged from Origin before delivery to Schenker WH.\n', 'Corrective Action : \nSchenker ID already notified consignee/ABB that claim is not valid, because it\'s informed one month after delivery.\nAlso there\'s no damage remark from photos, tally report, and cargo delivery report.', 'Preventive Action : \nSchenker ID already notified Consignee/ABB, if any damaged to be informed immediately on the same delivery date. Not one month after.\n\nSchenker ID maintain good cargo tracking (photos + docs + report) and handling for all LCL shipment.', '', 'C0000000151-000', '28-02-2017 16:38:32', '', '');
INSERT INTO `dbs_aac` (`id`, `id_complaint_form`, `id_user_assign`, `received_date`, `possibility_causes`, `corrective_action`, `preventive_action`, `evidence_img`, `child_id_aac`, `date_response_action_complaint`, `reject_reason`, `hod_reject_reason`) VALUES
(179, 0000000152, 893, '02-03-2017 19:42:58', 'eBilling already received twice, but GE did not make payment timely\n\nPIB prepared by Adde (Custom Clearance Team)\nDelay payment from GE, waiting BPN \ne-Billing code generated twice, waiting BPN from GE\nBack and forth communication because PIB draft keep exceeding Wednesday (change currency exchange)\nBack and forth communication because requesting BPN from GE\n\nPIB 091365 \nTuesday, January 31, 2017            - PIB draft available for GE to check\nWednesday, February 01, 2017  - Revised PIB draft with revised currency\nThursday, February 02, 2017       - PIB draft confirmed by UPS\nThursday, February 02, 2017       - PIB signed and stamped\nWednesday, February 08             - Revised PIB draft with revised currency\nWednesday, February 08, 2017 - PIB signed and stamped \nFriday, February 10                         - PIB revise with Bapeten number\nMonday, February 13, 2017         - NPBL response\nMonday, February 13, 2017         - e-billing code response (expired payment date 17-02-2017); waiting BPN\nMonday, February 20, 2017         - NEW e-billing code response (expired payment date 24-02-2017 ); waiting BPN\nThursday, February 23, 2017       - BPN provided \nThursday, February 23, 2017       - SPPB response available (greenline)\n\n', 'Corrective Action : \n1. reminding GE for soonest PIB draft confirmation \n2. reminding GE to provide BPN soonest', 'Preventive Action :\n1. faster confirmation from GE for PIB draft after currency exchange, \n2. faster BPN availability from GE', '', 'C0000000152-000', '02-03-2017 19:47:41', '', ''),
(180, 0000000153, 893, '02-03-2017 19:49:20', 'e-Billing already provided, but GE did not immediately pay / provide BPN\n\nPIB prepared by Adde (Custom Clearance Team)\nDelay because “izin Alkes” rejected, Port of Discharge do not match. \nDelay payment from GE, waiting BPN \n\nBack and forth communication because “Izin Alkes” is not showing Port of Discharge\nBack and forth communication because requesting BPN\n\nPIB 091371\nFriday, February 03, 2017              - PIB draft available for GE to check\nTuesday, February 07, 2017         - PIB signed and stamped\nWednesday, February 08, 2017  - Revised PIB draft with revised currency + signed and stamped\nFriday, February 10, 2017              - PIB revise with Bapeten number\nFriday, February 10, 2017              - Reject “izin Alkes” , Port of Discharge do not match \nFriday, February 17, 2017              - Respond NPP \nMonday, February 20, 2017         - Trying to resubmit\nThursday, February 23, 2017       - e-billing code response (expired payment date 27-02-2017 ) ; waiting BPN\nTuesday, February 28, 2017         - Custom Portal on transition (HS code 10 ? 8 digit)\nThursday, March 02, 2017             - e-billing not available due to NPBL respond (should have been paid on Feb 23rd by GE)\n', 'Corrective Action : \n1. reminding GE for soonest PIB draft confirmation \n2. reminding GE to provide BPN soonest\n', 'Preventive Action :\n1. faster confirmation from GE for PIB draft after currency exchange, \n2. faster BPN availability \n3. payment problem with Citibank (suggest same pic who is communicating payment deduction with bank) \n4. “Izin Alkes” showing Port of Discharge is blank in data upload by GE. Current permit expired on Jan 07th 2020. This is no problem anymore.\n5. Bapeten is expired on Feb 28th 2017\n', '', 'C0000000153-000', '02-03-2017 19:53:46', '', ''),
(181, 0000000155, 808, '08-03-2017 08:02:08', '', '', '', '', 'C0000000155-000', '', '', ''),
(182, 0000000156, 564, '13-03-2017 13:40:44', 'miss communication', 'send email to customer for clarification but still not replied by her', 'team consolidation', '', 'C0000000156-000', '30-03-2017 09:33:06', '', 'What is the mis communication?\nPlease also give a call back to customer if they dont give a reponse on an email?\n\nYigit'),
(183, 0000000157, 743, '07-04-2017 16:59:41', 'Thank you for your feed back\nWe try to manage the process more faster in the future \nShould you have any further inquiry, please let us know  ', 'review clearance process ', 'review clearance process ', '', 'C0000000157-000', '07-04-2017 17:04:56', '', ''),
(184, 0000000158, 743, '07-04-2017 16:59:59', 'Noted rcvd your positive feedback\nShould you have further inquiry, please let us know\nWe try our best to speed up clearance process in the future  ', 'review clearance process ', 'review clearance process ', '', 'C0000000158-000', '07-04-2017 17:06:51', '', ''),
(185, 0000000160, 850, '07-01-2010 22:58:37', 'Human error', 'has been revised in 2010', 'has been revised in 2010', '', 'C0000000160-000', '07-01-2010 22:59:37', '', ''),
