(187, 0000000165, 743, '27-10-2017 16:12:28', 'NOA Created 24th Oct (not sent waiting ATA and Doc availability) \nATA 26th Oct at 13;30 \nOriginal  Doc available to be picked up from Airline 16:30 ; arrived office after office hours (process next working days) \nNOA Sent by email 27th Oct 13:51 (still on schedule) ', 'Consider NOA sent to customer as per time line', 'Since the process as per timeline \nNo further action need \nJust Will remind our team to speed up the process\n', 'MCO-28050043_ATA_26th_Oct_as_per_airline_webtrack_http.docx', 'C0000000165-000', '27-10-2017 16:33:35', '', ''),
(188, 0000000166, 684, '01-11-2017 11:51:03', '1. Trucking flatbed with container 40\' flat rack come late to our location, on Saturday, and cannot catch the schedule. We have to wait until next schedule. \n( truckng late because, the journey management plan was not done yet )\n\n2. The wooden floor of container was crack when loading the goods. \n( the cargo/goods was too heavy and causing container floor cracked \nthere was incorrect stuffing process, which should be using forklift i/o using hand crane )\n\n3. We need it have to be solve today. \n( schedule already late as per above explanation ) \n', '1. Trucking flatbed with container 40\' flat rack come late to our location, on Saturday, and cannot catch the schedule. We have to wait until next schedule. \n( we changed trucking head to enable container/truck can enter customer site)\n\n\n2. The wooden floor of container was crack when loading the goods. \n( we replaced the container with good wooden floor condition )\n\n3. We need it have to be solve today. \n( already coordinated with related party to have it solved within the day) \n', 'preventive action: \n\n1. Trucking flatbed with container 40\' flat rack come late to our location, on Saturday, and cannot catch the schedule. We have to wait until next schedule. \n( implement the journey management plan before arranging the shipment)\n\n2. The wooden floor of container was crack when loading the goods. \n( remind customer to use proper tool/equipment for stuffing by using forklift )\n\n3. We need it have to be solve today. \n( make good coordination with related parties before trucking/container delivery )\n', '', 'C0000000166-000', '08-11-2017 14:02:53', '', 'No need to copy the problem in the corrective action part, please only state the corrective action,,'),
(189, 0000000168, 743, '01-11-2017 14:47:36', 'The correct H AWB is BLQ40190800 instead of BLQ40190080\nSorry for being lat reply , fully understand that we need you to provide fast reply with correct information, for specific H AWB BLQ40190800; shipment arrived CGK over the week end, the following next day we start the process ', 'Further corrective action, try to speed up doc and admin process for shipment arrive over the week end  ', 'no further action, document already available on (MON) 30th Oct at 0900 ; being pick up by customer appointed custom broker (TUE) 31st Oct at 14:43', 'BLQ40190800_ATA_29th_Oct_as_per_airline_webtrack_http.docx', 'C0000000168-000', '01-11-2017 15:08:09', '', ''),
(190, 0000000169, 782, '01-11-2017 15:11:12', 'this only test', 'Corrective Action* 1', 'Corrective Action* 2', '', 'C0000000169-000', '01-11-2017 15:12:00', '', ''),
(191, 0000000167, 743, '01-11-2017 15:18:27', 'miss communication and communication manner', '- Will remind again to all staff about communication manner and speed up process .. \n- provide back up an and escalation contact \n', 'no further action for specific case, shipment already cleared (SPPB) on 26th Oct', '', 'C0000000167-000', '03-11-2017 10:54:25', '', 'Please get back to customer with a response and also create the back up system where supervisor monitor the response to client of the delay if the main CS in charge is not responding. Please also discuss with the staff directly on this mis out \n\nYigit'),
(192, 0000000170, 782, '01-11-2017 15:23:16', 'test', 'test', 'test', '', 'C0000000170-000', '01-11-2017 15:23:29', '', ''),
(193, 0000000156, 551, '03-11-2017 13:16:08', '', '', '', '', 'C0000000156-001', '', '', ''),
(194, 0000000171, 695, '08-11-2017 15:15:50', '1. Respons sppb : 9 Agustus 2017 \n2. Resposn NPD : 4 September 2017 \n3. Respon SPTNP : 7 September 2017. \nWhy when Schenker received NPD response September 4, 2017 there was no information coming to Tetra Pak when we got import license freeze on November 7, 2017”\n4.Implants has overlook for SPTNP respons which already sent from Surabaya team and not inform also forward to Tetra Pak Indonesia.', '1.When we got information there are SPTNP not paid and Tetra Pak license got freeze, implant immediately action to request ebilling to Surabaya team.\n2.Once we got ebilling then immediately pay this SPTNP/Notul at the same time.\n3.Sending the BPN to Surabaya team for open blocakge.', '1.Implants will pay more attention for every respon SPTNP/Notul received from EDI team and must immediately inform Tetra Pak at the same time.\n2.Need also follow up by EDI or branch team if they not received feedback from implant in any case SPTNP/Notul.', '', 'C0000000171-000', '16-11-2017 18:17:34', '', ''),
(195, 0000000172, 695, '08-11-2017 15:48:27', '1. Respons sppb : 9 Agustus 2017 \n2. Resposn NPD : 4 September 2017 \n3. Respon SPTNP : 7 September 2017. \nWhy when Schenker received NPD response September 4, 2017 there was no information coming to Tetra Pak when we got import license freeze on November 7, 2017”\n', 'We have processed e-billing and paid SPTNP at the same time we got information this SPTNP.', 'We will more full pay attention for every customs respon SPTNP and action immediately to inform customer and settled it soon.', '', 'C0000000172-000', '14-11-2017 11:06:50', '', ''),
(196, 0000000166, 684, '08-11-2017 16:18:08', '1. truckng late because, the journey management plan was not done yet \n2. schedule already late as per above explanation \n3.already coordinated with related party to have it solved within the day\n ', '1.we changed trucking head to enable container/truck can enter customer site\n2. we replaced the container with good wooden floor condition \n3.already coordinated with related party to have it solved within the day', '1. implement the journey management plan before arranging the shipment\n2.remind customer to use proper tool/equipment for stuffing by using forklift \n3.make good coordination with related parties before trucking/container delivery', '', 'C0000000166-001', '08-11-2017 16:26:46', '', ''),
(197, 0000000173, 544, '14-11-2017 11:02:32', 'Cargo move other agent (LESHACO) consolidation and need to be open blockage in the PROCARS for payment AWB Fee in the Schenker Finance to LESHACO account until SCH can pick up original AWB at LESHACO', 'Simplify registration vendor process and payment request for other agent activity', 'Simplify registration vendor process and payment request for other agent activity', '', 'C0000000173-000', '14-11-2017 11:05:23', '', ''),
(198, 0000000172, 695, '14-11-2017 12:20:18', '1.Wrong delivery address Aju 101831 cont# CAIU8644681 / truck no. B9881UEJ / driver Bp.Feri.\n2.Driver was instructed parking by security of Monysaga to another area.\n3.Truck position was park in the wrong area.\n4.Causing delay un-loading process.\n', '1.Coordination with trucking team to move the container to the correct area.\n2.Coordination with customer PT.Monysaga in order process un-loading\n', '1.Driver must report to trucking coordinator if in future they have instruction by customer\'s security to parking in another area.\n2.Closely monitoring with PIC of customer.\n', '', 'C0000000172-001', '16-11-2017 17:56:05', 'wrong follow up ; mixed up with other case 0000000171 ; please kindly revise', 'Please be more specific what kind of action is taken, not general comment like coordination... please rework this.. thanks'),
(199, 0000000172, 695, '28-11-2017 11:35:34', '1.Wrong waiting / parking area of truck no. B 9881 UEJ (driver Bp. Feri) at Area customer PT. Monysaga.\n2.Driver have received instruction from Security of PT. Monysaga for parking place\n3.Truck have in wrong parking area and causing delay for un-loading process.\n', '1.Trucking team have contact driver to asked PT.Monysaga’s security why it’s been long time that containers not unloaded.\n2.Implant have contact PIC of PT.Monysaga for follow up container unloading and give information  our truck number details and driver’s mobile number.\n', '1.Educate driver once they have instruction from the customer’s security for parking another area, his must report this to trucking coordinator. \n2.Implant must closely follow up for container unloading process in order to avoid same case happen in future.\n', '', 'C0000000172-002', '22-03-2018 19:09:25', '', ''),
(200, 0000000175, 613, '30-11-2017 13:29:03', 'N/A', 'N/A', 'This should be assigned to respective Marunda 2 Warehouse Manager: teddy.f-susanto@dbschenker.com', '', 'C0000000175-000', '10-07-2018 01:31:28', '', ''),
(201, 0000000176, 544, '22-12-2017 10:28:29', 'Difficulties for identify cargo at Airlines warehouse terminal for combine shipment AC Room and normal storage due to Missing/broken label of AWB', '- Ask Origin to put AWB Label in to 2 or 4 side of cargo\n- Ask shipper or SCH Origin to additional packing with wrapping plastic ', '- Ask Origin to put AWB Label in to 2 or 4 side of cargo\n- Ask shipper or SCH Origin to additional packing with wrapping plastic ', '', 'C0000000176-000', '22-12-2017 15:08:22', '', ''),
(202, 0000000179, 695, '01-03-2018 10:32:45', '-Container for customer Monysaga have wrong delivery address.\n-Driver bring correct packing list for Monysaga but sent to wrong customer which is Heinz ABC\n-Trucking team have give wrong customer\'s address to our vendor trucking.\n', '- Has contact driver and customer to do not open the seal and container\'s door.\n-Our trucking team has called our vendor trucking to re-move the container back to correct customer\'s address which is PT. Monysaga', '-Trucking team will more pay attention once he make a instruction to vendor trucking specially for delivery address must be correct.\n-Implant  will also closely monitor for every instruction team trucking to our vendors.\n', '', 'C0000000179-000', '15-03-2018 14:14:28', '', ''),
(203, 0000000180, 695, '05-03-2018 16:37:56', '-2 containers have failed delivery to customer Ultrajaya on Saturday March 03, 2018.\n-The reason is because there were long qeuque at the temporary storage/MPK since Friday night March 02, 2018.\n-Those 2 containers have loaded on the truck on Saturday March 03,2018 about 11.00 AM so then can\'t reach to Ultrajaya because long distance from MPK to Ultrajaya.\n', '-Trcuking team have closely follow up with person in charges at temporary storage MPK \n-We have inform the customer for the delay.\n-We have re-arrange the container to be arrive at  Ultrajaya on Monday March 05, 2018.\n', '- We will instruct our vendor trucking that truck must come earlier to yard of temporary storage MPK to avoid this case remain happen.\n- Try to explore another temporary storage company which possibility have more good service.', '', 'C0000000180-000', '15-03-2018 14:27:49', '', ''),
(204, 0000000182, 743, '05-07-2018 12:39:33', 'auto reply not working as per expected ', 'We set auto reply for all staff that taking on leave', 'We remind all stall to set their auto reply, just before they are taking a leave (annual or maternity leave) ', '', 'C0000000182-000', '05-07-2018 12:44:04', '', ''),
(205, 0000000178, 743, '05-07-2018 12:39:47', 'No direct flight from Brazil to Jakarta, time difference made more difficult on communication ', 'Con call and made coordination with origin to ensure, T/Time from origin to destination as per agreed service contract  ', 'Set up and share SOP to origin and push origin (Brazil) to follow, transit time as per agreed on contract or SOP ', '', 'C0000000178-000', '05-07-2018 12:47:47', '', ''),
(206, 0000000184, 782, '05-07-2018 17:05:53', 'test', 'test', 'test', '', 'C0000000184-000', '13-08-2018 17:54:06', '', ''),
