(208, 0000000181, 775, '06-07-2018 14:36:30', 'The driver  does not know must wear the safety shoes if they are entry to Schenker Premises - atau mungkin mereka suka nyeker pak..', 'brief the driver immediately that they must wear PPE include safety shoes if they are entry to Schenker Premises', 'To deliver training regularly ', '', 'C0000000181-000', '06-07-2018 14:42:35', '', ''),
