(0000000014, 1, NULL, NULL, 14, 7, 'PT. COATES HIRE INDONESIA', 'Lambarfaithsani Prabawa', 'prabawa@ptcoates-services.com', 'shipment', '', 'Mohon dapat diinformasikan prosedur kami untuk melakukan claim mengenai kerusakan yang dialami unit kami untuk pengiriman Balikpapan – PKU.\n\nDari info yang kami terima dari cabang PKU, 4 Unit Lighting Tower ML4500 dari Balikpapan telah sampai di Pekanbaru per tanggal 9/2/15.\n\n2 unit dalam keadaan baik\n1 unit , 1 housingya rusak pada lampu & lens\n1 unit tabung hydrolic lepas\n\nBerdasarkan analisa team kami, pengikatan yg kurang baik mengakibatkan belt putus dan unit bergoyang2 sepanjang perjalanan.\n', '11-02-2015 08:56:10', 'external', 0, '', NULL, '203.80.11.108', 'closed', 1, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
