(0000000038, 1, NULL, NULL, 15, 4, 'Medion Farma Jaya, Pt', 'Pupu Pujiawati', 'mid@medion.co.id', 'shipment', '', 'Inv.No.70508094\nLate to send documents and still need correction.\nThe staf at the warehouse or operation in Jakarta did not cooperative with us. Please concern of this trouble. We hope on the next shipment will go smoothly. Thank you and regards.\n\n', '09-04-2015 13:09:22', 'external', 15, 'Dear Sales / Kamo Team,\n\nPlease kindly need to check the complaint from Medio Farma\n\nThanks & best regards,\nAnggri', NULL, '43.249.141.21', 'verified', 1, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
