(0000000040, 1, NULL, 17, 9, 12, 'DB Schenker', 'Mutiara Muslim', 'mutiara.muslim@dbschenker.com', 'shipment', '', 'Our MDM team is working depended on the ticketing system for the job list.\nBut this year MDM facing so many issue in the system that causing them to working late until night to catching up the job completion delayed because of the issue.\n\nAfter the issue listed down, 9 out of 13 issues is caused by Server/Network problem. Below is the list:\n15-Jan-15 Network Error\n5-Feb-15 Network Error\n11-Feb-15 Network Error\n20-Feb-15 Server Maintenance\n25-Mar-15 09:08 AM Network Error  (09.08 AM)\n25-Mar-15 11.39 AM Network Error for the second time (11.39 AM)\n1-Apr-15 Server Maintenance\n7-Apr-15 Server Maintenance\n8-Apr-15 Network Error\n\nNeed your help in the IT department to look up on this issue to get a solution and action for this. So we can have a continuous improvement for both sides.\n\n', '20-04-2015 10:45:50', 'internal', 0, '', NULL, '167.184.214.6', 'closed', 1, 0, '1', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
