(0000000089, 1, NULL, NULL, 5, 12, 'PT Indocement Tunggal Prakkarsa Tbk', 'James Webster', 'james.webster@indocement.co.id', 'other', '', 'We have goods belonging to our company, that are being held by your company here in Indonesia. There is a dispute  between your customer, who is our contractor, and the local Schenker in Indonesia.\nThe goods belong to us. They are being used to blackmail the contractor. \nThis is now holding up my project completion.\nI am totally shocked that such a large international company would resort to blackmail to settle a disputed claim for storage costs. below is a quote from your representative.\n\nIf this demurrage charges not settle by this week then my management instruct me to hold your last cargo until we receive the payment.” \n\nThat in my book is blackmail. The goods are not the property of the company you have the dispute with.\n\nPlease help to settle this issue urgently. ', '11-03-2016 08:41:52', 'external', 5, '', NULL, '10.10.10.1', 'rejected', NULL, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
