(0000000099, 1, NULL, NULL, 27, 12, 'PT. Procter & Gamble Operations Indonesia ( Cakung )', 'Suwarto Wasito', 'wasito.sa@pg.com', 'other', '', 'receive email from Mr. wasito 22-03-16 about shipment HUB&SPOKE; FSCU 7472163\n1. 01.30 WH call transporter for process loading, but transporter not coming\n2. 06.00 he Follow up and knowing if helper go home because sick ( without give confirmation with WH or Schenker )\n3. 09:30 replacement helper coming at DC but when ready process loading must cleaning container because dirty and and get fragment of glass\n\nthis issue very disturb operation because we can\'t optimize staging area  usage and it impact storage preparation for other customers delivery, \n\nplease pay attention for this issue never happen anymore.', '07-04-2016 16:33:22', 'external', 0, '', NULL, '10.10.10.1', 'verified', 1, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(0000000100, 1, NULL, NULL, 27, 12, 'PT. Procter & Gamble Operations Indonesia ( Karawang )', 'Yoga Ramadhani', 'ramadhani.yh@pg.com', 'other', '', 'receive email about incident from Mr. Yoga about shipment on 13 April 2016 at Karawang DC.\nOn Wednesday, April 13th 2016 afternoon 13.00 pm, Fabric Care will loading shipment to DC SBY in WH-A (DC Karawang) at Baby Care building. When truck container arrived to Parking area, security \"GSS\" to instruct the container for parking at the dock no. 12.\nWhen parking process driver container not hear direction from Security. and then back of Door Container hit the Up Dock Door no. 12.\nAfter we check up chassis height, so Door Container higher than dock door no.12, so dock door no. 12hitted.\n', '18-04-2016 08:08:52', 'external', 0, '', NULL, '10.10.10.1', 'acknowledged', NULL, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(0000000101, 1, NULL, NULL, 27, 1, 'PT. Procter & Gamble Operations Indonesia ( Cakung )', 'Yosua Kurniawan', 'kurniawan.y@pg.com', 'other', '', 'Receive Email from Mr. Yosua on 15 April 2016 about late delivery ( HUB&SPOKE; ) CLHU 9023380 when stuffing 12 April target can supposed depart on 14 April early morning and arrive to SUB 14 April evening, but in actual, train depart 14 April afternoon and arrive 15 April midday. \nThis is repeated issue that DB Schenker performance (2nd time on LATE Arrival and 2nd time order was rejected) cannot meet our expectation.\nThis is unacceptable and we cannot afford this to happen again.\n', '18-04-2016 08:13:29', 'external', 0, '', NULL, '10.10.10.1', 'verified', 1, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
