(0000000104, 1, NULL, NULL, 27, 12, 'PT BASF ( PARTNERS )', 'purwono', 'purwono.purwono@partners.basf.com', 'other', '', 'receive email complaint 29-04-16 from Mr Purwono about Driver leaving without confirmation with Schenker or Customer it self.\nDriver Name : Mr Sumahardi ( DAKOTA ) \n\nORIGINAL MESSAGE :\n\nDear Ibu Yus,\n\nBersama ini saya beritahukan, bahwa rencana muat hari ini ke gudang BASF Surabaya di batal kan karena driver yang bernama Bapak Sumahardi, pulang / kembali ke pool tanpa ada pemberitahuan ke kami atau pun security, semua dokumen yang di bawa driver di tinggal di kantor Saya dan KTP nya di tinggal begitu saja di POS Security BASF, berikut adalah kronologis nya :\n\n1.      Container sampai di BASF Cikarang Pukul 16:00 Sore, karena hari ini kami sedang closing dan banyak melayani kiriman lokal, maka container yang mau ke Surabaya ini kami lewati antrian nya oleh mobil lain karena material nya sedang kami prepair.\n\n2.       Pukul 22:30 material sudah mau di muat ternyata saya dapat info dari security bahwa driver nya kabur begitu saja tanpa ada info/izin ke Security.\n\n3.      Tolong besok Sabtu Pagi segera di kirim kembali container nya dengan driver yang berbeda dan KTP yang di tinggal di security harus di ambil langsung oleh Bapak Sumahardi, karena dia harus bertanggung jawab atas kejadian ini.\n\nKind regards,\n \nMS. Purwono\nCEVA Logistics – Site BASF Cikarang/ Jl Jababeka V Blok I No.1 www.cevalogistics.com/ T: +62 21 8934340 Ext. 205/ M: +628999974112\n \nMaking business flow \n', '02-05-2016 09:36:38', 'external', 0, '', NULL, '10.10.10.1', 'verified', 1, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(0000000105, 1, NULL, 27, 10, 1, 'DB Schenker', 'Choerur Rozikin', 'choerur.rozikin@dbschenker.com', 'other', '', 'receive email from Mr Rozikin, 29-04-16 about truck late arrive at WH.\nbased on request Mr  Rozikin order for 2 truck but only 1 truck arrive at WH.\n\nORIGINAL MESSAGE :\n\n1. Original Request 28-04-16 at 11:27PM:\n    Dear mbak Ira \n \n \nTolong di preparing cont. 2 x 40” dengan schedule di bawah ini dan konfirmasinya  : \n \nStuffing schedule    : 29 – 04 – 2016\n \nTrain schedule      : \n  KALOG 1 KALOG 2\n  SENIN - MINGGU SELASA, KAMIS, SABTU\nATD JAKARTA 1:40 12:25\nATA SURABAYA 16:15 7:15\nCUT OFF CONTAINER DI STATION JAKARTA 16:00 4:00\n \nAlamat pick up \nPT. Schenker Petrolog Utama \nWarehouse Distribution Center\nMarunda Center Estate block R 1 no: 2 - 3\nPhone   : (+62) 8118671644\n \nAlamat Delivery \nPT. DSC INDONESIA\nKOMPLEK PERGUDANGAN BUMI MASPION\nKAV. BMU I NO.23\nJALAN ROMOKALISARI \nSURABAYA – JAWA TIMUR\nCP :      ERLAN BENJAMIN – 089634152082\n            RUSTAM – 081807315899\n \nThank you / Danke\n \nBest Regard / Mit freundlichen Grüßen\n \nChoerur Rozikin ( Mr )\nLogistics SCM Department\n \nPT. Schenker Petrolog Utama \nWarehouse Distribution Center\nMarunda Center Estate block R 1 no: 2 - 3\nPhone   : (+62) 8118671644\nMobile  :  (+62) 817729032\nEmail    :  choerur.rozikin@dbschenker.com\n\n2. Update Truck Position email 29-04-16 at 19:30PM :\n  Dear rail service team \n \n \nTolong di info status cont. 2 x 40” tujuan gudang DHL Surabaya saat ini di mana ….? Sampai sekarang belum ada yang masuk ke Marunda 2 .\n \nThank you / Danke\n \nBest Regard / Mit freundlichen Grüßen\n \nChoerur Rozikin ( Mr )\nLogistics SCM Department\n \nPT. Schenker Petrolog Utama \nWarehouse Distribution Center\nMarunda Center Estate block R 1 no: 2 - 3\nPhone   : (+62) 8118671644\nMobile  :  (+62) 817729032\nEmail    :  choerur.rozikin@dbschenker.com\n\n3. Actual Confirmation Truck Arrival email 29-04-16 at 23:30PM :\n\nDear all \n\n\nHari ini