(0000000133, 1, NULL, 5, 5, 12, 'DB Schenker', 'Marco Pietsch', 'marco.pietsch@dbschenker.com', 'other', '', 'The complain is regarding the long processing time for re-registering existing vendor. \nWe had to re-register the local agent of international carrier YANGMING in Surabaya, due to blocking by MDM. \nAll available documents are provided on 20.10. by scan to Linda. The hard copy were submitted the days after.\nOur SUB office had to check on 26.10. on the status, as we receive no update if documents received and in process or anything missing.\nOn 01.11. Linda has informed us the SAP registration number. Based on this number we assume that blocking is opened.\nOn 09.11. our OPS team want to input the incoming invoice from YANGMING carrier and face issue that vendor ID still blocked. After checking with MDM, they claim to have no received the documents. Linda/Kennedy claim that documents are not complete on same day.\nWe have to resend the soft scan, which shows that from our perspective the documents are complete, except of what the local agent office in Surabaya could not supply (SPPKP only available in their Jakarta office).\n\nThe Operation team is not in control to choose this carrier - or not, because it is by nominated shipments, so we need to definitely register their local agent. \n\nHow could we make the registration & re-registration process smooth and transparent for our requesting office?', '09-11-2016 13:27:01', 'internal', 5, '', NULL, '10.10.10.1', 'rejected', NULL, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(0000000134, 1, NULL, NULL, 10, 11, 'PT. Merck Chemicals and Life Sciences', 'Ifan Apriliano', 'ifan.apriliano@merckgroup.com', 'other', '', 'Finding Audit From Government Agency - Animal Quarantine related with cleaning and hygiene is very disapointing, please check and respond Immidiately.\nSpecially finding on rat droppings, is this means that there\'s rat in the storage / Room 2 ???', '29-11-2016 10:37:40', 'external', 0, '', NULL, '10.10.10.1', 'submitted', NULL, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
