(0000000136, 1, NULL, 23, 23, 6, 'DB Schenker', 'Eko Andaryanto', 'eko.andaryanto@dbschenker.com', 'shipment', 'ATSZG400960125', 'Incurring demurrage charges due to mistake info of free time from Origin. Demurrage claim is IDR 25,650,000 / USD 1,912.21', '09-12-2016 09:03:39', 'internal', 0, '', NULL, '10.10.10.1', 'completed', NULL, 0, '1', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(0000000137, 1, NULL, 23, 23, 2, 'DB Schenker', 'Eko Andaryanto', 'eko.andaryanto@dbschenker.com', 'shipment', 'THBKK0000000660', 'Origin delay in sending Pre Alert. Pre Alert received after vessel arrived. Origin delay in changing oBL into SW Bill. Pioneer complaint because cannot pickup DO, BL status still oBL. ', '09-12-2016 09:28:36', 'internal', 0, '', NULL, '10.10.10.1', 'completed', NULL, 0, '1', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(0000000138, 1, NULL, 16, 16, 1, 'DB Schenker', 'Marco Pietsch', 'marco.pietsch@dbschenker.com', 'other', '', 'The relocation of customer in Surabaya is planned for 27/28.12 . Empty boxes for packing by customer were informed to be delivered on 16.11 or 17.11 first, but then cancelled due to a mess up from warehouse.\nThe boxes were requested again on 02.12 due to customer request. Removal team informed on 06.12 that boxes are scheduled to arrive in SUB within same week.\nOn 13.12. Removal team inform, that boxes will depart from JKT on 14.12. - and arrival scheduled by 16.12. only. \nCustomer now complain due to the lengthy process from 02.12 until 16.12 for the delivery.', '13-12-2016 14:39:09', 'internal', 0, '', NULL, '10.10.10.1', 'submitted', NULL, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(0000000140, 1, NULL, NULL, 2, 12, 'PT Sysmex Indonesia', 'Wiwik Ruspriandari', 'ruspriandari.wiwik@sysmex.co.id', 'shipment', '69508995291', 'Air Import team always late give the NOA and Freight collect to us even we reminded before ETA.   Duties payment and lead time for clearance will impact for us.  We have regular shipment with the same day for ETD (Friday) and ETA (Tuesday/Wednesday), and the good must be delivered to our warehouse by appointed forwarder next Friday.  All that processed should be settled timely within 2 days.  Regarding to the above matter, we need good communication and coordination with Schenker team. Any improvement from Schenker Air Import division will be high appreciated.  Thanks and best Regards    ', '22-12-2016 11:18:03', 'external', 0, '', NULL, '10.10.10.1', 'completed', NULL, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(0000000141, 1, NULL, NULL, 23, 1, 'PT. Nishiyama Indonesia', '', '0', 'shipment', 'JPTYO0000023124', 'The service from Ocean Dept and especially Japan Division are good, cooperative and helpful.\nWe only encountered one problem which was late delivery.\nNevertheless, we\'re very pleased with the service.\nThank you.', '03-01-2017 13:56:26', 'external', 0, '', NULL, '10.10.10.1', 'completed', NULL, 0, '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
