(0000000167, 1, NULL, NULL, 2, 8, 'PT PRATAMA GRAHA SEMESTA', 'Julia Adelina', 'julia@ptpgs.co.id', 'shipment', 'MHG-34319192', 'Saya menanyakan ke Pak Iwan Sukanto: kenapa proses dari PIB ke NPBL itu butuh waktu lama, jika saya tidak tanya di tgl 16 Oct tidak ada reminder atau notifikasi apapun. Kebetulan memang ada 2 shipment dari sender yg sama, 1 Dokumen saya koreksi minta revisi, satu lagi harusnya ok karena saya tidak minta revisi. Ternyata tidak diproses s/d tgl 16 Oct, Apakah jika customer tidak menanyakan status barang, shipment ini dibiarkan begitu saja?? Apakah tidak ada reminder atau notifikasi staff Schenker kepada customer? Dan ketika saya menanyakan \"kenapa\", beliau malah menyalahkan saya sebagai customer yang tidak memberi konfirmasi. Sebagai penyedia jasa/service harusnya Staff Schenker yang harus mengingatkan/memfollow up ke cust. Bukannya tunggu customer yang nanya. Tlg ditraining lagi mengenai Hospitality ke karyawan yang bersangkutan. dan juga saya minta invoice dari hari kamis tgl 26 Okt by phone, janji Jumat pagi mau dikirim. Sampe Senin baru dikirim. ', '31-10-2017 11:10:50', 'external', 0, '', NULL, '36.79.115.82', 'completed', NULL, 0, '1', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
