(0000000201, 1, NULL, 15, 7, NULL, 'DB Schenker', 'Dewi Gita Puspitasari', 'dewi.g-puspitasari@dbschenker.com', NULL, NULL, NULL, '28-12-2018 18:39:36', 'internal', 0, '', NULL, '114.124.140.124', 'open', NULL, 0, '', 1, '2018-12-28', '2018-12-28', 'Claims Usage Regulation for Glasses ', 'Healthcare Benefit (outpatient) ', 'Employees Benefit ', 0, 'Emailing: Announcement - Benefit Klaim Kacamata 2019', 'Dear Schenker management,\n\nAfter receiving your new regulation regarding Claim usage for glasses and refer to the last CPS, its regrettable such regulations with minimum benefit managed to pass through management screening.\nYear on year the company has enjoyed double digit GP and Ebit growth\n* 2016 EBIT increased by  12% vs 2015\n* 2016 GP increased by 13% vs 2015\n* 2017 EBIT increased by 14% vs 2016\n* 2017 GP increased by 14% vs 2016\n\nThe company is progressing a lot year on year, but why the benefit for employee is now being cut down? \n\nLooking at the amount that can be claimed by employee for glasses is just below market price. By this it just does not reflect with Schenker\'s Purpose & Values of play fair and be honest, win together and be one team with one goal, whereby the company expect the employees to adhere to this values but in return the company reluctant to apply the values when it comes to employees benefit and welfare.\nSincerely appreciate your consideration on this matter and please do take this in positive light.\n\nThank you.\n    \n', 1),
(0000000202, 1, NULL, 15, 7, NULL, 'DB Schenker', 'Adhitya Anggripinanto ', 'Adhitya.anggripinanto@dbschenker.com', NULL, NULL, NULL, '31-12-2018 10:46:01', 'internal', 0, '', NULL, '165.225.112.134', 'open', NULL, 0, '', 1, '2018-12-31', '2018-12-28', 'Employee Benefit', 'HR Policy', 'Glasses Reimbursement', 0, '0', 'Complaint about employee benefit', 1),
(0000000203, 1, NULL, 15, 7, NULL, 'DB Schenker', 'Adhitya Anggripinanto ', 'Adhitya.anggripinanto@dbschenker.com', NULL, NULL, NULL, '31-12-2018 11:00:59', 'internal', 0, '', NULL, '165.225.112.134', 'open', NULL, 0, '', 1, '2018-12-31', '2018-12-28', 'Employee Benefit', 'HR Policy', 'Glasses Reimbursement', 0, '0', 'Dear Human Resources Management,\n\nLast Friday, I have received a surprising news about the glasses claim policy. Looking at the amount that can be claimed by employee for glasses is just below market price. The amount is also very different from the Survey that was broadcasted by Serikat Pekerja.  By this, employees is pushed to find low quality glasses and lens and use their own money to have at least the appropriate quality. it just does not reflect with Schenker\'s Purpose & Values of win together.\n\nI do feel an adjustment to the policy is needed, as it is not fair to the employee. As you know, that we have experience double digit growth in terms of EBIT, GP, and Revenue since 2014. We do hope that employees can experience the growth also, not only the company.\n\nThank you for your considerations, please do take this as a positive input. \n', 1),
(0000000204, 1, NULL, NULL, 15, NULL, 'DB Schenker', 'Mario Marchell', 'mario.marchell@dbschenker.com', NULL, NULL, NULL, '02-01-2019 10:53:14', 'external', 15, '', 'This is not a sales issue, please assign to the correct department. ', '114.124.206.239', 'rejected', NULL, 0, '', 1, '2019-01-02', '2017-11-16', 'Glasses Claim', 'Glasses Claim Amount', 'Amount is not suficient', 1, 'E: Emailing: Announcement - Benefit Klaim Kacamata 2019', 'Dear Human Resources Management,\n\nLast week, I have received email from HR regarding the glasses claim policy. Looking at the amount that can be claimed by employee for glasses is just below market price. The amount is also very different from the Survey that was broadcasted by SPSI.  By this, employees is pushed to find low quality glasses and lens and use their own money to have at least the appropriate quality. it just does not reflect with Schenker\'s Purpose & Values of win together.\n\nI believe company can review again for adjustment to the policy . As you know, from CPS last month we have experience double digit growth in terms of EBIT, GP, and Revenue for 2018. We do hope that employees can experience the growth also, not only the company.\n\nThank you for your considerations, please do take this as a positive input.\n\n', 1),
