(0000000212, 0000000224, NULL, 'Cargo not delivered on requested date (11 Mar 2019)', 'Cargo must be delivered on requested date (11 Mar 2019)', 'Jakarta', '11 Mar 2019', 'Customer Checking for delivery status on 13 Mar 2019', 'Re_TOP_URGENT_FW_TP200ml_Choco.pdf', '1) Inform Customer the delivery status.\n2) Communicate with trucking team for delivery status.\n3) Trucking team Instruct Vendor (MB) for immediate delivery.', '2019-03-13', 'Raymond Andre Lekahena', 'Schenker not delivery cargo as requested date from Customer (11 Mar 2019)', 'Trucking Vendor did not feedback for Schenker delivery instruction', 'Schenker Implant did not re-check with trucking vendor on delivery status ', 'Ops/Trucking team did not re-check trucking vendor on delivery status', '', 'Schenker Implant and Ops/Trucking team did not re-check delivery status from trucking vendor, while our trucking vendor did not respond to our early delivery instruction.', '1) Schenker Implant to always re-check delivery instruction from Ops/Trucking Team (to Trucking Vendor)\n2) Schenker Implant to always ask for feedback from Ops/Trucking Team, and also follow up with Trucking Vendor for delivery status\n3) Schenker Implant to contact driver/Trucking Vendor/Ops/Trucking team for delivery status\n4) Schenker Implant to ensure intense coordination between Implant, Ops/Trucking Team and Trucking Vendor\n5) Schenker Implant to receive feedback from Trucking Vendor and Contact Driver on actual position latest in the morning on the delivery date\n', '1) Schenker Implant to always re-check delivery instruction from Ops/Trucking Team (to Trucking Vendor)\n2) Schenker Implant to always ask for feedback from Ops/Trucking Team, and also follow up with Trucking Vendor for delivery status\n3) Schenker Implant to contact driver/Trucking Vendor/Ops/Trucking team for delivery status\n4) Schenker Implant to ensure intense coordination between Implant, Ops/Trucking Team and Trucking Vendor\n5) Schenker Implant to receive feedback from Trucking Vendor and Contact Driver on actual position latest in the morning on the delivery date\n', '2019-03-14', 'Raymond Andre Lekahena', '1. Schenker Implant to always double check for delivery instruction\n2. Schenker Implant to always contact trucking team if not receive delivery status from Trucking Vendor\n', '2019-03-13', 'Raymond Andre Lekahena', 'others', 'refresh on standard delivery/trucking arrangement ', '', NULL, NULL, 893, '2019-03-13 18:26:18', 893, '2019-03-13 21:24:50'),
(0000000213, 0000000224, NULL, 'Cargo not delivered on requested date (11 Mar 2019)', 'Cargo must be delivered on requested date (11 Mar 2019)', 'Jakarta', '11 Mar 2019', 'Customer Checking for delivery status on 13 Mar 2019', 'Re_TOP_URGENT_FW_TP200ml_Choco.pdf', '1) Inform Customer the delivery status.\n2) Communicate with trucking team for delivery status.\n3) Trucking team Instruct Vendor (MB) for immediate delivery.', '2019-03-13', 'Raymond Andre Lekahena', 'Schenker not delivery cargo as requested date from Customer (11 Mar 2019)', 'Trucking Vendor did not feedback for Schenker delivery instruction', 'Schenker Implant did not re-check with trucking vendor on delivery status ', 'Ops/Trucking team did not re-check trucking vendor on delivery status', '', 'Schenker Implant and Ops/Trucking team did not re-check delivery status from trucking vendor, while our trucking vendor did not respond to our early delivery instruction.', '1) Schenker Implant to always re-check delivery instruction from Ops/Trucking Team (to Trucking Vendor)\n2) Schenker Implant to always ask for feedback from Ops/Trucking Team, and also follow up with Trucking Vendor for delivery status\n3) Schenker Implant to contact driver/Trucking Vendor/Ops/Trucking team for delivery status\n4) Schenker Implant to ensure intense coordination between Implant, Ops/Trucking Team and Trucking Vendor\n5) Schenker Implant to receive feedback from Trucking Vendor and Contact Driver on actual position latest in the morning on the delivery date\n', '1) Schenker Implant to always re-check delivery instruction from Ops/Trucking Team (to Trucking Vendor)\n2) Schenker Implant to always ask for feedback from Ops/Trucking Team, and also follow up with Trucking Vendor for delivery status\n3) Schenker Implant to contact driver/Trucking Vendor/Ops/Trucking team for delivery status\n4) Schenker Implant to ensure intense coordination between Implant, Ops/Trucking Team and Trucking Vendor\n5) Schenker Implant to receive feedback from Trucking Vendor and Contact Driver on actual position latest in the morning on the delivery date\n', '2019-03-14', 'Raymond Andre Lekahena', '1. Schenker Implant to always double check for delivery instruction\n2. Schenker Implant to always contact trucking team if not receive delivery status from Trucking Vendor\n', '2019-03-13', 'Raymond Andre Lekahena', 'others', 'Schenker Team to emphasize again to all member to use the daily monitoring report in Tetra Pak office and align with Trucking Team at Head Office\nTetra Pak team & Schenker team will have urgent alignment meeting on 15 Mar 2019 at Tetra Pak Office', '', NULL, NULL, 893, '2019-03-14 18:57:08', 893, '2019-03-14 18:57:24'),
